con:configuration.scriptText:
def country =context.testCase.getPropertyValue("country")
def year =context.testCase.getPropertyValue("year")

def groovyUtils = new com.eviware.soapui.support.GroovyUtils( context )
def responseHolder = groovyUtils.getXmlHolder( "getGprByCountryNameAndYear#Response" )
def gdp = responseHolder.getNodeValue("//ns2:getGprByCountryNameAndYearResponse/return/gdp")

if(country.equals("Austria")){
	if(year.equals("2003")){
		assert gdp =="0.9"
	}else if(year.equals("2006")){
		assert gdp =="3.7"
	}else if(year.equals("2009")){
		assert gdp =="-3.8"
	}else if(year.equals("2012")){
		assert gdp =="0.8"
	}
}else if(country.equals("Croatia")){
		if(year.equals("2003")){
		assert gdp =="5.1"
	}else if(year.equals("2006")){
		assert gdp =="4.9"
	}else if(year.equals("2009")){
		assert gdp =="-6.9"
	}else if(year.equals("2012")){
		assert gdp =="-2.0"
	}
}else if(country.equals("Spain")){
		if(year.equals("2003")){
		assert gdp =="3.1"
	}else if(year.equals("2006")){
		assert gdp =="4.1"
	}else if(year.equals("2009")){
		assert gdp =="-3.7"
	}else if(year.equals("2012")){
		assert gdp =="-1.4"
	}
}else if(country.equals("Malta")){
		if(year.equals("2003")){
		assert gdp =="0.7"
	}else if(year.equals("2006")){
		assert gdp =="2.6"
	}else if(year.equals("2009")){
		assert gdp =="-2.6"
	}else if(year.equals("2012")){
		assert gdp =="0.8"
	}
}else if(country.equals("Italy")){
		if(year.equals("2003")){
		assert gdp =="0.0"
	}else if(year.equals("2006")){
		assert gdp =="2.2"
	}else if(year.equals("2009")){
		assert gdp =="-5.5"
	}else if(year.equals("2012")){
		assert gdp =="-2.4"
	}
}

